        function grid(arr, str) {
            var rowMax = [];
            for (var i=0; i<arr.length; i++)
            {
                var newArr = arr[i].slice();
                newArr.sort();
                rowMax.push(newArr[arr.length-1]);
            }
            rowMax.sort();
            var maxNum = rowMax[rowMax.length-1];
            console.log(maxNum);
            var n = arr.length;
            var ret = "<p style='display:inline-table;'> <h1> "+ str+ "</h1><table style='display:inline-table;'>";
            for (var i=0; i < n ; i++)
            {
                ret += "<tr> ";
                for (var j=0;j<n; j++)
                {
                    ret += "<td bgcolor=" ;
                    ret += "rgb(" + 255*arr[i][j]/maxNum+ "[j],0,0)";
                    ret += "> X </td>";
                }
                ret += "</tr> ";
            }
            ret += "</table> </p>";
            var original = $("#ret").html(); 
            $("#ret").html(original+"</br>"+ret); 
        }
        function vectorToArray(vector)
        {
            
            //assume vector size is a perfect square
            var n = Math.sqrt(vector.length);
            var ret = new Array(n);
            for (var i=0; i<n;i++) {
                ret[i] = new Array(n);
                for (var j=0; j<n; j++)
                    ret[i][j] = vector[n*i + j];
            }
            return ret;
        }
        function stringToArray (rawData) {
            var convertedData = rawData.split(',');
            var ret = [];
            for (var i = 0; i < convertedData.length; i++)
                ret.push(parseFloat(convertedData[i]));
            return ret;
        }

        function setUpGrid(str)
        {
            var a = trainingData[str];
            var b = stringToArray(a);
            var c = vectorToArray(b);
            grid(c, str);
        }
        main = function () {
            var alphabet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";
            for (var i=0; i<alphabet.length; i++)
                setUpGrid(alphabet.charAt(i));
